import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";import{o,c as p,e as t}from"./app.09d9ce72.js";const n={},s=t('<h2 id="\u9898\u76EE\u63CF\u8FF0" tabindex="-1"><a class="header-anchor" href="#\u9898\u76EE\u63CF\u8FF0" aria-hidden="true">#</a> \u9898\u76EE\u63CF\u8FF0</h2><p>\u5047\u5982\u6709\u4E00\u4E2A<strong>1G</strong>\u5927\u5C0F\u7684\u6587\u4EF6\uFF0C\u6587\u4EF6\u91CC\u6BCF\u4E00\u884C\u662F\u4E00\u4E2A\u8BCD\uFF0C\u6BCF\u4E2A\u8BCD\u7684\u5927\u5C0F\u4E0D\u8D85\u8FC7<strong>16byte</strong>\uFF0C\u8981\u6C42\u8FD4\u56DE\u51FA\u73B0\u9891\u7387\u6700\u9AD8\u7684100\u4E2A\u8BCD\u3002\u5185\u5B58\u5927\u5C0F\u9650\u5236\u662F<strong>10M</strong></p><h2 id="\u89E3\u6CD51" tabindex="-1"><a class="header-anchor" href="#\u89E3\u6CD51" aria-hidden="true">#</a> \u89E3\u6CD51</h2><p>\u7531\u4E8E\u5185\u5B58\u9650\u5236\uFF0C\u6211\u4EEC\u65E0\u6CD5\u76F4\u63A5\u5C06\u5927\u6587\u4EF6\u7684\u6240\u6709\u8BCD\u4E00\u6B21\u6027\u8BFB\u5230\u5185\u5B58\u4E2D\u3002</p><p>\u53EF\u4EE5\u91C7\u7528<strong>\u5206\u6CBB\u7B56\u7565</strong>\uFF0C\u628A\u4E00\u4E2A\u5927\u6587\u4EF6\u5206\u89E3\u6210\u591A\u4E2A\u5C0F\u6587\u4EF6\uFF0C\u4FDD\u8BC1\u6BCF\u4E2A\u6587\u4EF6\u7684\u5927\u5C0F\u5C0F\u4E8E10M\uFF0C\u8FDB\u800C\u76F4\u63A5\u5C06\u5355\u4E2A\u5C0F\u6587\u4EF6\u8BFB\u53D6\u5230\u5185\u5B58\u4E2D\u8FDB\u884C\u5904\u7406\u3002</p><p><strong>\u7B2C\u4E00\u6B65</strong>\uFF0C\u9996\u5148\u904D\u5386\u5927\u6587\u4EF6\uFF0C\u5BF9\u904D\u5386\u5230\u7684\u6BCF\u4E2A\u8BCDx\uFF0C\u6267\u884C <code>hash(x) % 500</code>\uFF0C\u5C06\u7ED3\u679C\u4E3Ai\u7684\u8BCD\u5B58\u653E\u5230\u6587\u4EF6f(i)\u4E2D\uFF0C\u904D\u5386\u7ED3\u675F\u540E\uFF0C\u53EF\u4EE5\u5F97\u5230500\u4E2A\u5C0F\u6587\u4EF6\uFF0C\u6BCF\u4E2A\u5C0F\u6587\u4EF6\u7684\u5927\u5C0F\u4E3A2M\u5DE6\u53F3\uFF1B</p><p><strong>\u7B2C\u4E8C\u6B65</strong>\uFF0C\u63A5\u7740\u7EDF\u8BA1\u6BCF\u4E2A\u5C0F\u6587\u4EF6\u4E2D\u51FA\u73B0\u9891\u6570\u6700\u9AD8\u7684100\u4E2A\u8BCD\u3002\u53EF\u4EE5\u4F7F\u7528HashMap\u6765\u5B9E\u73B0\uFF0C\u5176\u4E2Dkey\u4E3A\u8BCD\uFF0Cvalue\u4E3A\u8BE5\u8BCD\u51FA\u73B0\u7684\u9891\u7387\u3002</p><p>\u5BF9\u4E8E\u904D\u5386\u5230\u7684\u8BCDx\uFF0C\u5982\u679C\u5728map\u4E2D\u4E0D\u5B58\u5728\uFF0C\u5219\u6267\u884C <code>map.put(x, 1)\u3002</code></p><p>\u82E5\u5B58\u5728\uFF0C\u5219\u6267\u884C <code>map.put(x, map.get(x)+1)</code>\uFF0C\u5C06\u8BE5\u8BCD\u51FA\u73B0\u7684\u6B21\u6570\u52A01\u3002</p><p><strong>\u7B2C\u4E09\u6B65</strong>\uFF0C\u5728\u7B2C\u4E8C\u6B65\u4E2D\u627E\u51FA\u4E86\u6BCF\u4E2A\u6587\u4EF6\u51FA\u73B0\u9891\u7387\u6700\u9AD8\u7684100\u4E2A\u8BCD\u4E4B\u540E\uFF0C\u901A\u8FC7\u7EF4\u62A4\u4E00\u4E2A<strong>\u5C0F\u9876\u5806</strong>\u6765\u627E\u51FA\u6240\u6709\u5C0F\u6587\u4EF6\u4E2D\u51FA\u73B0\u9891\u7387\u6700\u9AD8\u7684100\u4E2A\u8BCD\u3002</p><p>\u5177\u4F53\u65B9\u6CD5\u662F\uFF0C\u904D\u5386\u7B2C\u4E00\u4E2A\u6587\u4EF6\uFF0C\u628A\u7B2C\u4E00\u4E2A\u6587\u4EF6\u4E2D\u51FA\u73B0\u9891\u7387\u6700\u9AD8\u7684100\u4E2A\u8BCD\u6784\u5EFA\u6210\u4E00\u4E2A\u5C0F\u9876\u5806\u3002</p><p>\u5982\u679C\u7B2C\u4E00\u4E2A\u6587\u4EF6\u4E2D\u8BCD\u7684\u4E2A\u6570\u5C0F\u4E8E100\uFF0C\u53EF\u4EE5\u7EE7\u7EED\u904D\u5386\u7B2C\u4E8C\u4E2A\u6587\u4EF6\uFF0C\u76F4\u5230\u6784\u5EFA\u597D\u6709100\u4E2A\u7ED3\u70B9\u7684\u5C0F\u9876\u5806\u4E3A\u6B62\u3002</p><p>\u7EE7\u7EED\u904D\u5386\u5176\u4ED6\u5C0F\u6587\u4EF6\uFF0C\u5982\u679C\u904D\u5386\u5230\u7684\u8BCD\u7684\u51FA\u73B0\u6B21\u6570\u5927\u4E8E\u5806\u9876\u4E0A\u8BCD\u7684\u51FA\u73B0\u6B21\u6570\uFF0C\u53EF\u4EE5\u7528\u65B0\u904D\u5386\u5230\u7684\u8BCD\u66FF\u6362\u5806\u9876\u7684\u8BCD\uFF0C\u7136\u540E\u91CD\u65B0\u8C03\u6574\u8FD9\u4E2A\u5806\u4E3A\u5C0F\u9876\u5806\u3002</p><p>\u5F53\u904D\u5386\u5B8C\u6240\u6709\u5C0F\u6587\u4EF6\u540E\uFF0C\u8FD9\u4E2A\u5C0F\u9876\u5806\u4E2D\u7684\u8BCD\u5C31\u662F\u51FA\u73B0\u9891\u7387\u6700\u9AD8\u7684100\u4E2A\u8BCD\u3002</p><p>\u603B\u7ED3\u4E00\u4E0B\uFF0C\u8FD9\u79CD\u89E3\u6CD5\u7684\u4E3B\u8981\u601D\u8DEF\u5982\u4E0B\uFF1A</p><ol><li>\u91C7\u7528<strong>\u5206\u6CBB</strong>\u7684\u601D\u60F3\uFF0C\u8FDB\u884C\u54C8\u5E0C\u53D6\u4F59</li><li>\u4F7F\u7528<strong>HashMap</strong>\u7EDF\u8BA1\u6BCF\u4E2A\u5C0F\u6587\u4EF6\u5355\u8BCD\u51FA\u73B0\u7684\u6B21\u6570</li><li>\u4F7F\u7528<strong>\u5C0F\u9876\u5806</strong>\uFF0C\u904D\u5386\u6B65\u9AA42\u4E2D\u7684\u5C0F\u6587\u4EF6\uFF0C\u627E\u51FA\u8BCD\u9891top100\u7684\u5355\u8BCD</li></ol><p>\u4F46\u662F\u5F88\u5BB9\u6613\u53EF\u4EE5\u53D1\u73B0\u95EE\u9898\uFF0C\u5728\u7B2C\u4E8C\u6B65\u4E2D\uFF0C\u5982\u679C\u8FD9\u4E2A1G\u7684\u5927\u6587\u4EF6\u4E2D\u6709\u67D0\u4E2A\u8BCD\u8BCD\u9891\u8FC7\u9AD8\uFF0C\u53EF\u80FD\u5BFC\u81F4\u5C0F\u6587\u4EF6\u5927\u5C0F\u8D85\u8FC710m\u3002\u8FD9\u79CD\u60C5\u51B5\u4E0B\u8BE5\u600E\u4E48\u5904\u7406\u5462\uFF1F</p><p>\u63A5\u4E0B\u6765\u770B\u53E6\u5916\u4E00\u79CD\u89E3\u6CD5\u3002</p><h2 id="\u89E3\u6CD52" tabindex="-1"><a class="header-anchor" href="#\u89E3\u6CD52" aria-hidden="true">#</a> \u89E3\u6CD52</h2><p><strong>\u7B2C\u4E00\u6B65</strong>\uFF1A\u4F7F\u7528\u591A\u8DEF\u5F52\u5E76\u6392\u5E8F\u5BF9\u5927\u6587\u4EF6\u8FDB\u884C\u6392\u5E8F\uFF0C\u8FD9\u6837\u76F8\u540C\u7684\u5355\u8BCD\u80AF\u5B9A\u662F\u7D27\u6328\u7740\u7684</p><p>\u591A\u8DEF\u5F52\u5E76\u6392\u5E8F\u5BF9\u5927\u6587\u4EF6\u8FDB\u884C\u6392\u5E8F\u7684\u6B65\u9AA4\u5982\u4E0B\uFF1A</p><p>\u2460 \u5C06\u6587\u4EF6\u6309\u7167\u987A\u5E8F\u5207\u5206\u6210\u5927\u5C0F\u4E0D\u8D85\u8FC72m\u7684\u5C0F\u6587\u4EF6\uFF0C\u603B\u5171500\u4E2A\u5C0F\u6587\u4EF6</p><p>\u2461 \u4F7F\u752810MB\u5185\u5B58<strong>\u5206\u522B</strong>\u5BF9 500 \u4E2A\u5C0F\u6587\u4EF6\u4E2D\u7684\u5355\u8BCD\u8FDB\u884C<strong>\u6392\u5E8F</strong></p><p>\u2462 \u4F7F\u7528\u4E00\u4E2A\u5927\u5C0F\u4E3A500\u5927\u5C0F\u7684\u5806\uFF0C\u5BF9500\u4E2A\u5C0F\u6587\u4EF6\u8FDB\u884C<strong>\u591A\u8DEF\u6392\u5E8F</strong>\uFF0C\u7ED3\u679C\u5199\u5230\u4E00\u4E2A\u5927\u6587\u4EF6\u4E2D</p><p>\u5176\u4E2D\u7B2C\u4E09\u6B65\uFF0C\u5BF9500\u4E2A\u5C0F\u6587\u4EF6\u8FDB\u884C\u591A\u8DEF\u6392\u5E8F\u7684\u601D\u8DEF\u5982\u4E0B\uFF1A</p><ul><li>\u521D\u59CB\u5316\u4E00\u4E2A\u6700\u5C0F\u5806\uFF0C\u5927\u5C0F\u5C31\u662F\u6709\u5E8F\u5C0F\u6587\u4EF6\u7684\u4E2A\u6570500\u3002\u5806\u4E2D\u7684\u6BCF\u4E2A\u8282\u70B9\u5B58\u653E\u6BCF\u4E2A\u6709\u5E8F\u5C0F\u6587\u4EF6\u5BF9\u5E94\u7684\u8F93\u5165\u6D41\u3002</li><li>\u6309\u7167\u6BCF\u4E2A\u6709\u5E8F\u6587\u4EF6\u4E2D\u7684\u4E0B\u4E00\u884C\u6570\u636E\u5BF9\u6240\u6709\u6587\u4EF6\u8F93\u5165\u6D41\u8FDB\u884C\u6392\u5E8F\uFF0C\u5355\u8BCD\u5C0F\u7684\u8F93\u5165\u6587\u4EF6\u6D41\u653E\u5728\u5806\u9876\u3002</li><li>\u62FF\u51FA\u5806\u9876\u7684\u8F93\u5165\u6D41\uFF0C\u5E76\u5176\u4E0B\u4E00\u884C\u6570\u636E\u5199\u5165\u5230\u6700\u7EC8\u6392\u5E8F\u7684\u6587\u4EF6\u4E2D\uFF0C\u5982\u679C\u62FF\u51FA\u6765\u7684\u8F93\u5165\u6D41\u4E2D\u8FD8\u6709\u6570\u636E\u7684\u8BDD\uFF0C\u90A3\u4E48\u5C06\u8FD9\u4E2A\u8F93\u5165\u6D41\u518D\u4E00\u6B21\u6DFB\u52A0\u5230\u6808\u4E2D\u3002\u5426\u5219\u8BF4\u660E\u8BE5\u6587\u4EF6\u8F93\u5165\u6D41\u4E2D\u6CA1\u6709\u6570\u636E\u4E86\uFF0C\u90A3\u4E48\u53EF\u4EE5\u5173\u95ED\u8FD9\u4E2A\u6D41\u3002</li><li>\u5FAA\u73AF\u8FD9\u4E2A\u8FC7\u7A0B\uFF0C\u76F4\u5230\u6240\u6709\u6587\u4EF6\u8F93\u5165\u6D41\u90FD\u6CA1\u6709\u6570\u636E\u4E3A\u6B62\u3002</li></ul><p><strong>\u7B2C\u4E8C\u6B65</strong>\uFF1A</p><p>\u2460 \u521D\u59CB\u5316\u4E00\u4E2A100\u4E2A\u8282\u70B9\u7684<strong>\u5C0F\u9876\u5806</strong>\uFF0C\u7528\u4E8E\u4FDD\u5B58100\u4E2A\u51FA\u73B0\u9891\u7387\u6700\u591A\u7684\u5355\u8BCD</p><p>\u2461 \u904D\u5386\u6574\u4E2A\u6587\u4EF6\uFF0C\u4E00\u4E2A\u5355\u8BCD\u4E00\u4E2A\u5355\u8BCD\u7684\u4ECE\u6587\u4EF6\u4E2D\u53D6\u51FA\u6765\uFF0C\u5E76\u8BA1\u6570</p><p>\u2462 \u7B49\u5230\u904D\u5386\u7684\u5355\u8BCD\u548C\u4E0A\u4E00\u4E2A\u5355\u8BCD\u4E0D\u540C\u7684\u8BDD\uFF0C\u90A3\u4E48\u4E0A\u4E00\u4E2A\u5355\u8BCD\u53CA\u5176\u9891\u7387\u5982\u679C\u5927\u4E8E\u5806\u9876\u7684\u8BCD\u7684\u9891\u7387\uFF0C\u90A3\u4E48\u653E\u5728\u5806\u4E2D\uFF0C\u5426\u5219\u4E0D\u653E</p><p>\u6700\u7EC8\uFF0C\u5C0F\u9876\u5806\u4E2D\u5C31\u662F\u51FA\u73B0\u9891\u7387\u524D100\u7684\u5355\u8BCD\u4E86\u3002</p><p>\u89E3\u6CD52\u76F8\u5BF9\u89E3\u6CD51\uFF0C\u66F4\u52A0\u4E25\u8C28\uFF0C\u5982\u679C\u67D0\u4E2A\u8BCD\u8BCD\u9891\u8FC7\u9AD8\u6216\u8005\u6574\u4E2A\u6587\u4EF6\u90FD\u662F\u540C\u4E00\u4E2A\u8BCD\u7684\u8BDD\uFF0C\u89E3\u6CD51\u4E0D\u9002\u7528\u3002</p><h2 id="\u70B9\u5173\u6CE8-\u4E0D\u8FF7\u8DEF" tabindex="-1"><a class="header-anchor" href="#\u70B9\u5173\u6CE8-\u4E0D\u8FF7\u8DEF" aria-hidden="true">#</a> \u70B9\u5173\u6CE8\uFF0C\u4E0D\u8FF7\u8DEF</h2><p>\u5927\u5F6C\uFF0C<strong>\u975E\u79D1\u73ED\u51FA\u8EAB\uFF0C\u81EA\u5B66Java</strong>\uFF0C\u6821\u62DB\u65A9\u83B7\u4EAC\u4E1C\u3001\u643A\u7A0B\u3001\u534E\u4E3A\u7B49offer\u3002\u4F5C\u4E3A\u4E00\u540D\u8F6C\u7801\u9009\u624B\uFF0C\u6DF1\u611F\u8FD9\u4E00\u8DEF\u7684\u4E0D\u6613\u3002</p><p>\u5E0C\u671B\u6211\u7684\u5206\u4EAB\u80FD\u5E2E\u52A9\u5230\u66F4\u591A\u7684\u5C0F\u4F19\u4F34\uFF0C<strong>\u6211\u8E29\u8FC7\u7684\u5751\u4F60\u4EEC\u4E0D\u8981\u518D\u8E29</strong>\u3002\u60F3\u4E0E\u5927\u5F6C\u4EA4\u6D41\u7684\u8BDD\uFF0C\u53EF\u4EE5\u5230\u516C\u4F17\u53F7\u540E\u53F0\u83B7\u53D6\u5927\u5F6C\u7684\u5FAE\u4FE1~</p><p>\u540E\u53F0\u56DE\u590D\u300E <strong>\u7B14\u8BB0</strong>\u300F\u5373\u53EF\u9886\u53D6\u5927\u5F6C\u65A9\u83B7\u5927\u5382offer\u7684<strong>\u9762\u8BD5\u7B14\u8BB0</strong>\u3002</p><p><img src="http://img.dabin-coder.cn/image/\u516C\u4F17\u53F7.jpg" alt="" loading="lazy"></p>',37),e=[s];function a(g,i){return o(),p("div",null,e)}var h=r(n,[["render",a],["__file","find-hign-frequency-word.html.vue"]]);export{h as default};
